import React from "react";
import SquareComponent from "./SquareComponent";

function BoardComponent() {
  const squaresArray = [];

  for (let i = 0; i < 65; i++) {
    squaresArray.push(<SquareComponent key={i} number={i} />);
    console.log(squaresArray);
  }
  return (
    <div
      style={{
        width: "800px",
        height: "800px",
        textAlign: "center",
        display: "flex",
        alignItems: "center",
        flexWrap: "wrap",
      }}
    >
      {squaresArray}
    </div>
  );
}
export default BoardComponent;
